import React, { Component } from 'react';
import "../public/app.css"

class App extends Component {
   

    render() {
        return (
            <div>
                <h3>当前计数为xxx</h3>
                <select name="" id="" ref="selectNumber">
                    <option value="1">1</option>
                    <option value="2">2</option>
                    <option value="3">3</option>
                </select>
                <button>+</button>
                <button>-</button>
                <button>偶数+</button>
                <button>异步+</button>
            </div>
        );
    }
}

export default App;
